import React from 'react';
import { FooterContainer, FooterSection, FooterWrapper, Waves } from './footer.styles';

const Footer = () => {
	const footerData = [
		{
			title: 'Section One',
			content: ['Content One', 'Content Two', 'Content Three'],
		},
		{
			title: 'Section Two',
			content: ['Content One', 'Content Two', 'Content Three'],
		},
		{
			title: 'Section Three',
			content: ['Content One', 'Content Two', 'Content Three'],
		},
	];
	return (
		<div>
			<Waves />
			<FooterContainer>
				{footerData.map((item) => (
					<FooterWrapper>
						<FooterSection>
							<h4>{item.title}</h4>
							<div className="content">
								{item.content.map((sec) => (
									<div>{sec}</div>
								))}
							</div>
						</FooterSection>
					</FooterWrapper>
				))}
			</FooterContainer>
		</div>
	);
};

export default Footer;
